INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, "2030/01/01 14:59:59", 2, 190804, 1000003, 2.801, -416.5, "カリン", "2025/01/31 12:00:00", 63, 1, 3, "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, "2030/01/01 14:59:59", 2, 190804, 1000004, 0.0, -416.5, "カリン", "2025/01/31 12:00:00", 63, 2, 4, "報酬がもらえますよ！\nチェックしてみてください", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, "2030/01/01 14:59:59", 1, 190804, 1000005, 2.12, -363.0, "カリン", "2025/01/31 12:00:00", 64, 2, 5, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, "2030/01/01 14:59:59", 2, 190804, 1000006, 1.68, -363.0, "カリン", "2025/01/31 12:00:00", 64, 1, 6, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, "2030/01/01 14:59:59", 1, 190804, 1000007, 2.33, -363.0, "カリン", "2025/01/31 12:00:00", 64, 2, 7, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, "2030/01/01 14:59:59", 7, 133701, 1020101, 5.18, -285.0, "ラビリスタ", "2025/01/31 12:00:00", 61, 3, 101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, "2030/01/01 14:59:59", 2, 133901, 1020102, 8.77, -285.0, "クリスティーナ", "2025/01/31 12:00:00", 61, 1, 201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, "2030/01/01 14:59:59", 1, 133801, 1020103, 15.5, -285.0, "ネネカ", "2025/01/31 12:00:00", 61, 6, 301, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10202, "2030/01/01 14:59:59", 5, 134301, 1020201, 9.061, -285.0, "ランファ", "2025/02/28 12:00:00", 61, 2, 101, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10202, "2030/01/01 14:59:59", 2, 134401, 1020202, 7.699, -285.0, "チカ", "2025/02/28 12:00:00", 61, 1, 201, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10203, "2030/01/01 14:59:59", 2, 134601, 1020301, 8.595, -285.0, "アオイ", "2025/03/31 12:00:00", 61, 1, 101, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10203, "2030/01/01 14:59:59", 2, 134501, 1020302, 7.758, -285.0, "クローチェ", "2025/03/31 12:00:00", 61, 1, 201, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, "2030/01/01 14:59:59", 6, 132302, 1020401, 7.0, -285.0, "ルイズマリー", "2025/04/30 12:00:00", 61, 2, 101, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, "2030/01/01 14:59:59", 2, 132402, 1020402, 7.904, -285.0, "イロハ", "2025/04/30 12:00:00", 61, 1, 201, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, "2030/01/01 14:59:59", 2, 132502, 1020403, 8.487, -285.0, "ソノ", "2025/04/30 12:00:00", 61, 4, 301, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10205, "2030/01/01 14:59:59", 2, 134901, 1020502, 8.763, -285.0, "カノン", "2025/05/31 12:00:00", 61, 1, 101, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10205, "2030/01/01 14:59:59", 3, 134801, 1020503, 6.417, -285.0, "ツムギ", "2025/05/31 12:00:00", 61, 1, 201, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, "2030/01/01 14:59:59", 7, 135001, 1020601, 10.335, -285.0, "エリス", "2025/06/30 12:00:00", 61, 3, 101, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, "2030/01/01 14:59:59", 4, 135101, 1020602, 6.281, -285.0, "シェフィ", "2025/06/30 12:00:00", 61, 2, 201, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, "2030/01/01 14:59:59", 2, 135201, 1020603, 12.244, -285.0, "プレシア", "2025/06/30 12:00:00", 61, 1, 301, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10207, "2030/01/01 14:59:59", 8, 135301, 1020701, 6.339, -285.0, "クリア", "2025/07/31 12:00:00", 61, 2, 101, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10207, "2030/01/01 14:59:59", 9, 135401, 1020702, 8.184, -285.0, "アネモネ", "2025/07/31 12:00:00", 61, 7, 201, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, "2030/01/01 14:59:59", 2, 129101, 1020801, 3.906, -285.0, "アイラ", "2025/08/31 12:00:00", 61, 9, 101, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, "2030/01/01 14:59:59", 2, 129201, 1020802, 14.465, -285.0, "シナツ", "2025/08/31 12:00:00", 61, 1, 201, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, "2030/01/01 14:59:59", 3, 100101, 1020803, 8.662, -285.0, "ヒヨリ", "2025/08/31 12:00:00", 61, 4, 301, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, "2030/01/01 14:59:59", 3, 100301, 1020804, 10.915, -285.0, "レイ", "2025/08/31 12:00:00", 61, 1, 401, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, "2030/01/01 14:59:59", 7, 135802, 1020901, 6.042, -285.0, "ユキノ", "2025/09/30 12:00:00", 61, 1, 101, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, "2030/01/01 14:59:59", 1, 135903, 1020902, 9.402, -285.0, "サツキ", "2025/09/30 12:00:00", 61, 4, 201, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, "2030/01/01 14:59:59", 1, 136902, 1020903, 8.16, -285.0, "ルルィ", "2025/09/30 12:00:00", 61, 8, 301, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, "2030/01/01 14:59:59", 2, 137401, 1021001, 5.0, -285.0, "カスミ", "2025/10/31 12:00:00", 61, 3, 101, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, "2030/01/01 14:59:59", 1, 136001, 1021002, 8.12, -285.0, "アラクネ", "2025/10/31 12:00:00", 61, 4, 201, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, "2030/01/01 14:59:59", 2, 136202, 1021003, 6.386, -285.0, "ナーナ", "2025/10/31 12:00:00", 61, 4, 301, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10211, "2030/01/01 14:59:59", 4, 136402, 1021101, 7.438, -285.0, "ユイ", "2025/11/30 12:00:00", 61, 3, 101, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10211, "2030/01/01 14:59:59", 5, 136302, 1021102, 8.35, -285.0, "ミソラ", "2025/11/30 12:00:00", 61, 1, 201, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, "2030/01/01 14:59:59", 2, 136501, 1021201, 5.0, -285.0, "シズル", "2025/12/31 12:00:00", 61, 1, 101, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, "2030/01/01 14:59:59", 2, 137902, 1021202, 5.25, -285.0, "リノ", "2025/12/31 12:00:00", 61, 1, 201, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 0.0);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, "2030/01/01 14:59:59", 2, 106801, 1021203, 7.5, -285.0, "ラビリスタ", "2025/12/31 12:00:00", 61, 1, 301, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 0.0);
